import { Card } from 'antd';
import Avatar from 'antd/lib/avatar/avatar';
import { Button } from 'antd/lib/radio';

const UserProfile = () => {
    return (
        <Card
            action={[
                <div key="twit">
                    짹짹 <br /> 0
                </div>,
                <div key="follwings">
                    팔로잉 <br /> 0
                </div>,
                <div key="followers">
                    팔로워 <br /> 0
                </div>,
            ]}
        >
            <Card.Meta avatar={<Avatar>CU</Avatar>} title="chanuk" />
            <Button>Logout</Button>
        </Card>
    );
};

export default UserProfile;
